('el', '_msgs', 'AT_CONFIRM_GRANT_WRITE_PERMISSION', 'Παρακαλώ εκχωρήστε δικαίωμα <strong>εγγραφής</strong> στο φάκελο: %s<p><strong>Σημείωση:</strong> Για να αλλάξετε δικαιώματα στο Unix χρησιμοποιήστε <kbd>chmod a+rw</kbd> έπειτα το όνομα του αρχείου.</p>', '2013-01-17 09:21:14', ''),
