('el', '_msgs', 'AT_CONFIRM_STUDENT_GROUP', 'Είσαστε σίγουροι ότι θέλετε να προσθέσετε τους παρακάτω χρήστες στην ομάδα \'%s\'; <ul>%s</ul>', '2005-09-23 10:29:56', ''),
('el', '_msgs', 'AT_CONFIRM_STUDENT_REMOVE_GROUP', 'Είσαστε σίγουροι ότι θέλετε να <strong>διαγράψετε</strong> τους παρακάτω μαθητές από την ομάδα \'%s\'; <ul>%s</ul>', '2005-09-23 10:47:22', ''),
