('el', '_msgs', 'AT_ERROR_ADMIN_EDIT_OWN_ACCOUNT', 'Για να επεξεργαστείτε τον δικό σας λογαριασμό, χρησιμοποιήστε  τη σελίδα: <a href=\"admin/admins/my_edit.php\">Ο λογαριασμός μου</a>', '2013-01-17 09:23:06', ''),
('el', '_msgs', 'AT_ERROR_ALREADY_ENROLED', 'Έχετε ήδη κάνει αίτηση για αυτό το μάθημα και δεν έχει ακόμη εγκριθεί από τον διδάσκοντα. Θα ειδοποιηθείτε μόλις η αίτηση σας γίνει δεκτή.', '2004-07-05 15:44:11', ''),
('el', '_msgs', 'AT_ERROR_ALREADY_INSTALLED', 'Το επιλεγμένο αντικείμενο εμφανίζεται να έχει εγκατασταθεί.', '2013-01-14 11:49:45', ''),
