('el', '_msgs', 'AT_ERROR_ALTERNATIVE_ALREADY_DECLARED', 'Το αρχείο που επιλέξατε έχει ήδη οριστεί ως εναλλακτική για τον επιλεγμένο αρχικό πόρο.', '2013-01-14 11:53:00', ''),
