('el', '_msgs', 'AT_ERROR_ASSIGNMENT_CUTOFF', 'Έχει παρέλθει η ημερομηνία υποβολής της εργασίας. Δεν γίνονται αποδεκτές άλλες υποβολές εργασιών.', '2007-08-03 09:49:55', ''),
('el', '_msgs', 'AT_ERROR_BACKUP_RESTORE', 'Η αποκατάσταση απέτυχε - το αρχείο δεν είναι έγκυρο backup. Τα backup που είναι παλιότερα της έκδοσης 1.3 δεν υποστηρίζονται.', '2013-01-17 09:24:40', ''),
('el', '_msgs', 'AT_ERROR_BACKUP_UNSUPPORTED_GREATER_VERSION', 'Δεν υποστηρίζονται αρχεία ασφαλείας που έχουν δημιουργηθεί από εκδόσεις του ATutor μεγαλύτερες από την τρέχουσα έκδοση .', '2005-09-23 10:56:29', ''),
('el', '_msgs', 'AT_ERROR_BAD_DATE', 'Η ημερομηνία δεν είναι έγκυρη.', '2004-07-05 15:44:11', ''),
('el', '_msgs', 'AT_ERROR_BAD_FILE_TYPE', 'Ο τύπος αρχείου δεν υποστηρίζεται. Αποδεκτά μόνο αρχεία κειμένου και HTML.', '2004-07-05 15:44:11', ''),
('el', '_msgs', 'AT_ERROR_BAD_FOLDER_NAME', 'Το όνομα φακέλου περιέχει μη κατάλληλους χαρακτήρες. Μπορείτε να επιλέξετε από αλφαριθμητικούς χαρακτήρες και τους χαρακτήρες υπογράμμισης (underscore), παύλες ή τελείες.', '2005-09-23 10:57:42', ''),
('el', '_msgs', 'AT_ERROR_CACHE_DIR_BAD', 'Ο φάκελος της ενδιάμεσης μνήμης (cache) δεν μπορεί να δημιουργηθεί. Η ενδιάμεση μνήμη απενεργοποιήθηκε. Δείτε τις επιλογές διαμόρφωσης για να απενεργοποιήσετε ή να διορθώσετε το πρόβλημα.', '2005-09-23 10:58:36', ''),
('el', '_msgs', 'AT_ERROR_CACHE_DIR_NOT_EXIST', 'Το προσωρινό μονοπάτι δεν υπάρχει ή δεν είναι εγγράψιμο. Δημιουργήστε το και ορίστε δικαιώματα γραφής ώστε να καταστήσετε το μονοπάτι εγγράψιμο απο το χρήστη του Διαδικτυακού εξυπηρετητή του συστήματος.  (π.χ. chmod a+rwx cache)', '2013-01-14 11:59:35', ''),
('el', '_msgs', 'AT_ERROR_CANNOT_BE_EMPTY', 'Το πεδίο αναζήτησης δε μπορεί να είναι κενό.', '2013-01-14 12:00:17', ''),
('el', '_msgs', 'AT_ERROR_CANNOT_CONNECT_SERVER', 'Αποτυχία σύνδεσης στον εξυπηρετητή: %s', '2013-01-14 12:00:50', ''),
('el', '_msgs', 'AT_ERROR_CANNOT_CREATE_DIR', 'Δεν μπορεί να δημιουργηθεί ο κατάλογος περιεχομένου.\r\n', '2004-07-05 15:44:11', ''),
('el', '_msgs', 'AT_ERROR_CANNOT_DELETE_OWN_ACCOUNT', 'Δεν μπορείτε να διαγράψετε το λογαριασμό σας.', '2005-09-23 10:57:57', ''),
('el', '_msgs', 'AT_ERROR_CANNOT_OPEN_DIR', 'Αδύνατο να ανοιχθεί ο φάκελος περιεχομένου. Μπορείτε να προσπαθήσετε να τον <a href=\"tools/file_manager.php?create=1\">δημιουργήσετε τώρα</a>.', '2005-09-23 10:58:55', ''),
('el', '_msgs', 'AT_ERROR_CANNOT_OPEN_FILE', 'Δεν μπορεί να ανοιχθεί το αρχείο: <b>%s</b>', '2005-09-23 10:59:14', ''),
('el', '_msgs', 'AT_ERROR_CANNOT_OVERWRITE_FILE', 'Δεν είναι δυνατή η επανεγγραφή του αρχείου.', '2004-07-05 15:44:11', ''),
('el', '_msgs', 'AT_ERROR_CANNOT_READ_FILE', 'Δεν μπορεί να διαβαστεί το αρχείο: <b>%s</b>', '2005-09-23 10:59:32', ''),
