('el', '_template', 'atutor_accessibility_text', '<p>Το ATutor περιλαμβάνει μία ποικιλία χαρακτηριστικών που έχουν σχεδιαστεί για να διασφαλίσουν την προσβασιμότητά του από οποιονδήποτε ενδεχόμενο χρήστη, συμπεριλαμβανομένων αυτών με σύνδεση χαμηλής ταχύτητας στο Διαδίκτυο, παλιές εκδόσεις Πλοηγών, και ατόμων με αναπηρίες χρησιμοποιώντας βοηθητικές τεχνολογίες για πρόσβαση στο Διαδίκτυο. Τα χαρακτηριστικά αυτά περιγράφονται λεπτομερώς παρακάτω.</p>\r\n\r\n<ol>\r\n<li><b>Παρακαμπτήριοι Σύνδεσμοι:</b> Στην πάνω αριστερή γωνία του ATutor υπάρχει ένα πλήθος από κρυμμένους παρακαμπτήριους συνδέσμους οι οποίοι επιτρέπουν τους χρήστες των βοηθητικών τεχνολογιών να παρακάμψουν τα κοινά στοιχεία πλοήγησης και να μεταπηδήσουν απευθείας στο περιεχόμενο που προβάλλεται. Πατήστε Tab μια φορά αφού τελειώσει το φόρτωμα της σελίδας για να προχωρήσετε στον πρώτο παρακαμπτήριο σύνδεσμο και έπειτα πατήστε Enter για να αντικαταστήσετε το περιεχόμενο στην κορυφή της οθόνης. Ο δεσμός περιεχομένου μπορεί επίσης να προσπελαστεί με τη συντόμευση [Alt-c], ώστε να μπορείτε να μεταπηδήσετε στην αρχή της περιοχής περιεχομένου ασχέτως που βρίσκεται ο δρομέας στην οθόνη. <br /><br />\r\nΆλλοι παρακαμπτήριοι σύνδεσμοι περιλαμβάνουν \"μεταπήδηση στο τέλος του πίνακα\" ώστε οι χρήστες να μπορούν να μεταφερθούν γρήγορα σε περιεχόμενο που βρίσκεται μετά το τέλος του πίνακα,  \"μεταπήδηση στο τέλος των κωδικών\", ώστε οι χρήστες να μεταφερθούν πέρα από τους κώδικες των εικόνων συναισθημάτων (emoticon codes) κοντά στο τέλος της φόρμας δημοσίευσης μηνυμάτων στα φόρουμ.<br /><br /></li> <li><strong>\r\nΠλήκτρα Πρόσβασης (συντομεύσεις):</strong> Σε αρκετά χαρακτηριστικά του ATutor έχει προστεθεί προσιτότητα μέσω του πληκτρολογίου. Για να ενεργοποιήσετε τα πλήκτρα πρόσβασης, πατήστε Alt και το εκχωρημένο πλήκτρο αριθμού ή γράμματος. Τα πλήκτρα προσιτότητας εκχωρούνται δυναμικά στις καρτέλες του Κύριου Πλοηγού. Στην πρώτη καρτέλα εκχωρείται το [Alt-1], στη δεύτερη το [Alt-2] κλπ. Σημειώστε ότι δεν υποστηρίζουν πλήκτρα προσιτότητας όλοι οι οδηγοί.<br /><br /> Γενικά πλήκτρα προσιτόττητας:\r\n<ul>\r\n<li>[Alt-1 έως Alt-0] Καρτέλες Κύριου Πλοηγού</li>\r\n<li>[Alt-,] Προηγούμενο θέμα (δηλ. <)</li>\r\n<li>[Alt-.] Επόμενο θέμα (δηλ. >)</li>\r\n<li>[Alt-.] Συνέχιση (δηλ. > όταν ο δρομέας είναι εκτός της περιοχής περιεχομένου)</li>\r\n<li>[Alt-j] Μεταπήδηση σε μενού</li>\r\n<li>[Alt-s] Υποβολή (ενεργό σε πολλές φόρμες)</li>\r\n<li>[Alt-c] Μεταπήδηση στην κορυφή του περιεχομένου (παρακαμπτήριος σύνδεσμος στην αρχή)</li>\r\n<li>[Alt 8] Προηγούμενο Θέμα</li>\r\n<li>[Alt 9] Επόμενο Θέμα</li>\r\n<li>[Alt 0] Συνέχιση</li>\r\n<li>[Alt y] Βασική Πλοήγηση</li>\r\n<li>[Alt m] Μενού</li>\r\n<li>[Alt j] Μενού Μεταπήδησης</li>\r\n<li>[Alt s] Υποβολή (ενεργό σε σελίδες με φόρμες)</li>\r\n<li>[Alt c] Μεταπήδηση στην κορυφή του περιεχομένου (παρακαμπτήριος σύνδεσμος και σύνδεσμος κορυφής)</li>\r\n</ul>\r\n<p>Πλήκτρα Πρόσβασης Επεξεργαστή Περιεχομένου</p>\r\n<ul>\r\n<li>[Alt-n] Καρτέλα Περιεχόμενο</li>\r\n<li>[Alt-p] Καρτέλα Ιδιότητες</li>\r\n<li>[Alt-g] Καρτέλα Γλωσσάρι</li>\r\n<li>[Alt-r] Καρτέλα Προεπισκόπηση</li>\r\n<li>[Alt-a] Καρτέλα Προσιτότητα</li>\r\n<li>[Alt-s] Αποθήκευση</li>\r\n</ul>\r\n<p>Πλήκτρα Πρόσβασης Συνομιλίας</p>\r\n<ul>\r\n<li>[Alt-c] \r\nΜεταπήδηση στο πεδίο Σύνθεση Μηνύματος</li>\r\n<li>[Alt-r] Ανανέωση Μηνυμάτων</li>\r\n<li>[Alt-m] Μεταπήδηση στη Λίστα Μηνυμάτων</li>\r\n<li>[Alt-q] Έξοδος από τη συνομιλία</li>\r\n</ul>\r\nΠλήκτρα προσιτότητας Γραμματοκιβωτίου <ul> \r\n<li>[Alt-r] Απάντηση στα μηνύματα</li> \r\n</ul> \r\n<br />\r\n </li>\r\n<li><strong>Πιστοποίηση Προσιτότητας:</strong> Χρησιμοποιώντας τον Επεξεργαστή Περιεχομένου, οι διδάσκοντες μπορούν να ελέγξουν την προσιτότητα του περιεχομένου που δημιουργούν για να βεβαιωθούν ότι θα είναι προσιτό σε όλους τους χρήστες, συμπεριλαμβανομένων αυτών που χρησιμοποιούν βοηθητικές τεχνολογίες, όπως επίσης και εκείνους που χρησιμοποιούν παλαιότερες τεχνολογίες. Καθώς χρησιμοποιείτε τον Επεξεργαστή Περιεχομένου, επιλέξτε [Alt-a] για να ανοίξετε Πιστοποίηση Προσιτότητας.</li>\r\n\r\n<li><strong>Εναλλακτικό Κείμενο:</strong> Όλες οι εικόνες του ATutor εμπεριέχουν εναλλακτικό κείμενο το οποίο περιγράφει την εικόνα ή τη λειτουργία της. Όπου οι εικόνες δεν έχουν νόημα η ιδιότητα Alt αφήνεται κενή ώστε οι βοηθητικές τεχνολογίες να αγνοήσουν την εικόνα.</li>\r\n\r\n<li><strong>Εναλλακτική Πλοήγηση:</strong> Τα καθολικά, ιεραρχικά, και σειριακά εργαλεία πλοήγησης είναι διαθέσιμα έτσι ώστε οι χρήστες να μπορούν να προβάλουν ή να δομούν το περιεχόμενο με τον τρόπο που ταιριάζει περισσότερο στον τρόπο εκμάθησης τους. Ο χάρτης πλοήγησης του ATutor παρέχει μια πλήρη λίστα όλων των διαθέσιμων περιεχομένων και εργαλείων ώστε όλα τα χαρακτηριστικά ενός μαθήματος να μπορούν να προσπελαθούν από ένα μόνο σημείο.</li>\r\n\r\n<li><strong>Επανάκτηση/Συνέχιση: </strong>Το ATutor θυμάται την τελευταία σελίδα που επισκέφθηκαν οι χρήστες όταν εγκατέλειψαν το μάθημα, π.χ. για να πάνε στα φόρουμ, ώστε να μπορούν να επιστρέψουν γρήγορα πίσω εκεί από όπου έφυγαν. Το ATutor θυμάται επίσης το σημείο περιεχομένου ανάμεσα στις συνόδους (sessions), ώστε κατά την επιστροφή τους στο ATutor, οι χρήστες μπορούν απλά να επιλέξουν τον υπερσύνδεσμο Επαναφορά στη λίστα μαθημάτων Τα Μαθήματά μου, ή να επιλέξουν τον υπερσύνδεσμο Επαναφορά στο πάνω μέρος της οθόνης ενώ βρίσκονται σε ένα μάθημα. Με το πλήκτρο συντόμευσης [Alt-.] μπορούν επίσης οι χρήστες να επιστρέψουν στην τελευταία σελίδα περιεχομένου που βρίσκονταν από τη στιγμή που ξεκίνησαν το μάθημα.</li> \r\n\r\n<li><b>Απόκρυψη Μενού:</b> Για τους χρήστες παλαιότερων βοηθητικών τεχνολογιών που δεν υποστηρίζουν κείμενο σε στήλες πινάκων, έιναι δυνατή η απόκρυψη των μενού έτσι ώστε το περιεχόμενο να παρουσιάζεται σε γραμμική προβολή. Επίσης, η απόκρυψη των μενού εξοικονομεί χώρο για τους χρήστες μικρότερων οθονών.</li>\r\n\r\n<li><strong>Αναζήτηση και ταξινόμηση:</strong> Οι περισσότεροι πίνακες δεδομένων συνοδεύονται από ένα εργαλείο αναζήτησης, ή φίλτρο, ώστε συγκεκριμένες εγγραφές μπορούν να απεικονιστούν στον πίνακα, μειώνοντας τα δεδομένα που μπορούν να απεικονιστούν σε μια δεδομένη στιγμή. Οι περισσότεροι πίνακες δεδομένων μπορούν επίσης να ταξινομηθούν επιλέγοντας την επικεφαλίδα της στήλης, επιτρέποντας έτσι στους χρήστες να περιορίσουν τα δεδομένα που απεικονίζονται.</li>\r\n\r\n<li><strong>Σχέσεις επικεφαλίδων πινάκων: </strong>Όλοι οι πίνακες δεδομένων μαρκάρονται με το στοιχείο TH και την ιδιότητα scope ώστε οι χρήστες που χρησιμοποιούν αναγνώστες οθόνης να μπορούν να πλοηγηθούν στις οθόνες  και να καταλάβουν τι αναπαριστά κάθε κελί.</li>\r\n\r\n<li><strong>Ετικέτες Φορμών:</strong> Όλες οι ετικέτες των φορμών του ATutor δημιουργούνται με το στοιχείο LABEL για να διασφαλίσουν τη σωστή περιγραφή για τους χρήστες βοηθητικών τεχνολογιών. Η ρητή δημιουργία των ετικετών κατ\'αυτόν τον τρόπο καθιστά δυνατή τη μετάβαση σε ένα πεδίο μιας φόρμας πατώντας πάνω στην ετικέτα του πεδίου. Έτσι παρέχεται μια ευρύτερη ενεργή περιοχή για τα άτομα που αντιμετωπίζουν δυσκολίες όταν προσπαθούν να στοχεύσουν με το δείκτη του ποντικιού σε μικρά πεδία φορμών όπως ραδιοπλήκτρα ή πλήκτρα επιλογών.</li>\r\n\r\n<li><strong>Φύλλα Στυλ:</strong> Όποτε είναι δυνατό, η παρουσίαση του περιεχομένου στο ATutor ελέγχεται από φύλλα στυλ. Αυτό επιτρέπει στους χρήστες να παρακάμψουν την προεπιλεγμένη εμφάνιση του ATutor και να εφαρμόσουν τις δικές τους προτιμήσεις εμφάνισης (π.χ. αυξημένα μεγέθη γραμματοσειρών, διαφορετικά στυλ γραμματοσειρών, χρώματα, κτλ.) </li>\r\n\r\n<li><strong>Εστίαση σε Πεδία Φορμών:</strong> Στις σελίδες όπου το κύριο περιεχόμενο είναι μία φόρμα, ο δείκτης του ποντικιού τοποθετείται αυτομάτως στο πρώτο πεδίο της φόρμας έτσι ώστε μετά τη φόρτωση της σελίδας, οι χρήστες να μπορούν να ξεκινήσουν αμέσως την πληκτρολόγηση. Οι χρήστες μπορούν να απενεργοποιήσουν αυτό το χαρακτηριστικό στις ρυθμίσεις προτιμήσεων αν τους ενοχλεί.</li>\r\n\r\n<li><strong>Σχετική Αλλαγή Μεγέθους των Εικόνων:</strong> Στους πλοηγούς οι οποίοι υποστηρίζουν αλλαγή μεγέθους των εικόνων, τα εικονίδια του ATutor μπορουν να μεγενθυθούν για τους χρήστες με χαμηλή όραση, κάνοντας τα πιο ευδιάκριτα. (π.χ. στον Netscape 7 πιέστε Alt +) Όπου είναι δυνατό σχετικές μετρήσεις χρησιμοποιούνται και σε άλλα χαρακτηριστικά του ATutor ώστε όταν το περιβάλλον εργασίας μεγενθύνεται ή μικραίνει, όλα τα χαρακτηριστικά αλλάζουν μέγεθος σχετικά με τα υπόλοιπα, διατηρώντας έτσι τη συμμετρία τους. </li>\r\n</ol>', '2007-08-06 05:37:12', ''),
