('el', '_template', 'atutor_is', 'Το <strong><em>ATutor</em></strong> είναι ένα, Ανοιχτού Λογισμικού, Σύστημα Διαχείρισης Εκπαιδευτικού Περιεχομένου βασισμένο στο Web και σχεδιασμένο με βάση τη λογική της προσιτότητας και της προσαρμοσιμότητας. Οι Διαχειριστές μπορούν να εγταταστήσουν ή να αναβαθμίσουν ένα σύστημα ATutor σε λίγα λεπτά. Οι Εκπαιδευτικοί μπορούν γρήγορα να δημιουργήσουν, να πακετάρουν, να ανακατανείμουν το εκπαιδευτικό υλικό, και να διεξάγουν τα μαθήματά τους online. Οι Φοιτητές μαθαίνουν σε ένα προσαρμοστικό μαθησιακό περιβάλλον.', '2004-07-05 15:44:12', ''),
('el', '_template', 'atutor_links', '<p>Μάθετε περισσότερα για το <a href=\"http://atutor.ca/index.php\">ATutor</a> ακολουθώντας τους ακόλουθους συνδέσμους:</p>\r\n\r\n<ul>\r\n<li><a href=\"http://atutor.ca/atutor/docs/index.php\">FAQs</a> - Συχνές ερωτήσεις με τις απαντήσεις τους</li>\r\n<li><a href=\"http://atutor.ca/forums/index.php\">Υποστήριξη Forums</a> - Κάντε post στα forum</li>\r\n<li><a href=\"http://atutor.ca/services/index.php\">Υπηρεσίες Υποστήριξης</a> - Αν χρειαστείτε τη βοήθειά μας, είναι διαθέσιμη</li>\r\n<li><a href=\"http://atutor.ca/atutor/translate/index.php\">Μετάφραση</a> - Κατεβάστε πακέτα γλωσσών, γίνετε μεταφραστής</li>\r\n<li><a href=\"http://atutor.ca/services/licensing.php\">Licensing</a> - Το λογισμικό του ATutor είνια διαθέσιμο δωρεάν υπό κάποιους όρους</li>\r\n<li><a href=\"http://atutor.ca/atutor/download.php\">Download ATutor</a> - Όλο το απαιτούμενο λογισμικό για να εγκαταστήσετε το ATutor βρίσκεται εδώ</li>\r\n</ul>', '2007-08-06 05:46:27', ''),
