('el', '_template', 'chat_chime_help', 'Θέστε το σε \"Ναι\" για να ακούγεται ένας ηχητικός τόνος όταν ταχυδρομούνται νέα μηνύματα.Δεν λειτουργεί σε όλους τους Φυλλομετρητές Ιστοσελίδων.', '2004-07-05 15:44:12', ''),
