('el', '_template', 'chat_full_history', 'Πλήρες Ιστορικό', '2004-07-05 15:44:12', ''),
('el', '_template', 'chat_help_display_blurb', '<p>Σημείωση: Οι σύνδεσμοι<em>Ματαπήδηση σε</em> και η λίστα <em>Ταχέων Κουμπιών</em> εμφανίζεται μόνο εάν έχετε ενεργοποιήσει τις <em>Βοήθειές Πλοήγησης</em> στις προτιμήσεις σας.</p>\r\n\r\n<ul>\r\n<li>Ο σύνδεσμος  <em>Μεταπήδηση στα Ταχεία Κουμπιά</em> στην κορυφή, σας μεταφέρει σε μια λίστα ταχέων κουμπιών για τη Συνομιλία. </li>\r\n<li>Στην <em>Περιοχή Μηνυμάτων</em> προβάλλονται τα πιο πρόσφατα μηνύματα (μέχρι δέκα). </li>\r\n<li>Οι σύνδεσμοι <em>Μεταπήδηση στα Μηνύματα</em> σας μεταφέρουν στην αρχή της λίστας μηνυμάτων.(Alt+M) </li>\r\n<li>Ο σύνδεσμος <em>Ανανέωση Μηνυμάτων</em> σας επιτρέπει να ελέγχετε για νέα μηνύματα (Alt+R). </li>\r\n<li>Το Πεδίο <em>Σύνταξη Μηνύτματος </em> και το <em>Κουμπί Αποστολή</em> σας επιτρέπουν να εισάγετε και να στείλετε μηνύματα (Alt+C για να εισαχθείτε στο Πεδίο Σύνταξης, Enter για να στείλετε ένα ολοκληρωμένο μήνυμα). </li>\r\n</ul>', '2004-09-02 15:43:35', ''),
('el', '_template', 'chat_help_display_frame', 'Προβολή Πλαισίου Βοηθείας (πάνω αριστερά)', '2004-07-05 15:44:12', ''),
('el', '_template', 'chat_help_display_jump', 'Μεταπήδηση στο Πλαίσιο Βοηθείας', '2004-07-05 15:44:12', ''),
('el', '_template', 'chat_help_history_blurb', 'Η <em>Λίστα Χρηστών</em> προβάλλει τους κωδικούς Συνομιλίας όλων των χρηστών εντός της συνομιλίας. Πατήστε σε έναν κωδικό Συνομιλίας για να δείτε σταλμένα μηνύματα αυτού του συμμετέχοντος, μαζί με τα δικά σας μηνύματα. Πατήστε <em>Όλοι οι Χρήστες</em> για να δείτε τα σταλμένα μηνύματα όλων των συμμετεχόντων.', '2004-07-05 15:44:12', ''),
