('el', '_template', 'create_backup_about', '<p>Η δημιουργία αντιγράφου ασφαλείας για το μάθημα θα αρχειοθετήσει όλο το διαθέσιμο υλικό σε ένα συμπιεσμένο αρχείο ZIP. Μόλις δημιουργηθεί το αρχείο, θα είναι διαθέσιμο μέσω του διαχειριστή αντιγράφου ασφαλείας για κατέβασμα και ασφαλή αποθήκευση, ή για να επανακτηθεί στο τρέχον ή σε άλλο μάθημα. </p> <p> Ανάλογα με το μέγεθος του μαθήματος και τους διαθέσιμους πόρους του διακομιστή, ο χρόνος που απαιτείται για να δημιουργηθεί το αντίγραφο ασφαλείας μπορεί να πάρει κάποιο χρόνο.</p><p>Σημείωση:  Έχετε περιορισμό μέχρι %s αντίγραφα ασφαλείας ανά μάθημα.</p>', '2005-09-23 13:35:01', ''),
