('el', '_template', 'patcher_alter_modified_files', 'Τα καταχωρημένα αρχεία έχουν τροποποιηθεί τοπικά. Αν επιλέξετε να συνεχίσετε, το τοπικό αρχείο θα τροποποιηθεί.  Θα δημιουργηθεί αντίγραφο ασφαλείας του αρχικού αρχείου πριν αυτό τροποποιηθεί. Παρακαλώ σημειώστε οτι η τροποποίηση στον εξατομικευμένο κώδικα ίσως παραβεί την εξατομίκευσή σας.', '2013-01-11 11:02:09', ''),
('el', '_template', 'patcher_overwrite_modified_files', 'Τα αναφερόμενα αρχεία έχουν τροποποιηθεί τοπικά. Εάν αποφασίσετε να συνεχίσετε, το αρχείο επιδιόρθωσης θα αντιγραφεί στο τοπικό σας μηχάνημα. \r\nΠρέπει να συνενώσετε αυτό το αρχείο μαζί με το τοπικό σας αντίγραφο χειροκίνητα.<br />', '2013-01-11 11:13:04', ''),
('el', '_template', 'patcher_show_backup_files', 'Παρακάτω είναι η λίστα των αρχείων-αντιγράφων ασφαλείας που δημιουργήθηκαν απ τον επιδιορθωτή. Αφού διασφαλίσετε οτι το ATutor λειτουργεί κανονικά με την επιδιόρθωση, ίσως θελήσετε να διαγράψετε αυτά τα αρχεία. Εάν το ATutor δε λειτουργεί κανονικά με την επιδιόρθωση, μπορείτε πάντα να επαναφέρετε πίσω στα παλιά αρχεία μετονομάζοντας τα αντίγραφα ασφαλείας με τα ονάματα των αρχικών αρχείων, απομακρύνοντας το τμήμα [patch_id].old απο το όνομα του αρχείου. <br />', '2013-01-11 11:29:34', ''),
('el', '_template', 'patcher_show_patch_files', 'Παρακάτω βρίσκεται η λίστα με τα αρχεία επιδιόρθωσης που αντιγράφηκαν στον υπολογιστή σας. Παρακαλώ όπως συγχωνεύσετε χειροκίνητα τις αλλαγές μεταξύ των αρχείων επιδιόρθωσης και του τοπικού αντίγραφου. <br />', '2013-01-11 11:35:49', ''),
