('el', '_template', 'shindig_blurb', 'Εάν έχετε τις δικές σας ρυθμίσεις του εξυπηρετητή Shindig, μπορείτε να εισάγετε το URL για τον εξυπηρετητή εδώ. Εάν δεν έχετε το δικό σας εξυπηρετητή Shindig, μπορείτε είτε να αφήσετε το URL κενό, ή να χρησιμοποιήσετε τη διεύθυνση \"http://social.atutor.ca/shindig/php\" για να συνδεθείτε στο κοινωνικό δίκτυο του ATutor. Ο Shindig επιτρέπει στους χρήστες να συνδέσουν gadgets απο άλλoυς ιστότοπους στο δικό τους περιβάλλον κοινωνικής δικτύωσης, όπως επίσης και να επικοινωνήσουν με αυτά σε άλλα κοινωνικά δίκτυα. Εάν επιλέξετε να μην χρησιμοποιήσετε έναν εξυπηρετητή Shindig, το κοινωνικό σας δίκτυο θα λειτουργήσει ως ένα αυτάρκες δίκτυο, χωρίς πρόσβαση σε εξωτερικά δίκτυα.', '2013-01-14 09:29:23', ''),
